  const newExpenseDataHandler = newData => {
    updateExpenses((oldExpenses) => {
      return [...oldExpenses, newData];
    })
  }

  return (
    <div>
      <NewExpenses onAddNewExpenseData={newExpenseDataHandler} />
      <Expenses expenses={expenses}></Expenses>
    </div>
  );
}

export default App;
